def count_carry_operations(input_string: str) -> str:
    ans = []
    for ab in input_string.split(''):
        (carry, carried) = (0, 0)
        for (a, b) in zip(*map(lambda ss: map(int, ss[::-1]), ab.split())):
            carried += a + b
            carry += carried > 9
            carried //= 10
        ans.append(carry)
    return '\n'.join(('No carry operation' if not c else '%d carry operations' % c for c in ans))

